B.OD=new A.b6("Uygulaman\u0131n veri toplama prosed\xfcrlerini anlaman\u0131za yard\u0131mc\u0131 olacak, gizlilikle ilgili ayr\u0131nt\u0131l\u0131 bilgilere yer verilmektedir.BiNot, Mart 2023'te \xfcr\xfcn sayfalar\u0131na yeni bir gizlilik bilgileri b\xf6l\xfcm\xfc eklenece\u011fini duyurdu. Bu ad\u0131m, m\xfc\u015fterilere uygulamalar\u0131n kendileri hakk\u0131nda hangi verileri toplad\u0131\u011f\u0131n\u0131 daha \u015feffaf ve a\xe7\u0131klay\u0131c\u0131 \u015fekilde sunacak yenilik\xe7i bir program\u0131n ba\u015flang\u0131c\u0131d\u0131r. Bu yeni program, t\xfcm uygulamalar i\xe7in bilgilerin geli\u015ftiricinin kendisi taraf\u0131ndan bildirildi\u011fi, anla\u015f\u0131lmas\u0131 kolay bir sistem olu\u015fturmaktad\u0131r. BiNot, bu bilgileri do\u011fru \u015fekilde doldurabilmeleri i\xe7in geli\u015ftiricilere kaynaklar sa\u011flamaya devam edecektir. Bu gizlilik bilgileri b\xf6l\xfcm\xfc, herkes i\xe7in en uygun i\u015fleyi\u015fi hep beraber \xf6\u011frendik\xe7e geli\u015fecektir.",null,B.cQ,null,null,null,null,null,null)
B.OE=new A.b6("Gizlilik bilgileri b\xf6l\xfcm\xfc hakk\u0131nda",null,B.cP,null,null,null,null,null,null)
B.Oq=new A.b6("Yeni gizlilik bilgileri b\xf6l\xfcm\xfc bir uygulaman\u0131n BiNot'daki gizlilik prosed\xfcrlerini anlaman\u0131za yard\u0131mc\u0131 olur. Her uygulaman\u0131n \xfcr\xfcn sayfas\u0131nda, uygulama taraf\u0131ndan toplanabilecek baz\u0131 veri t\xfcrleri hakk\u0131nda bilgi edinebilir ve bu verilerin sizinle ili\u015fkilendirilip ili\u015fkilendirilmedi\u011fini veya sizi izlemek i\xe7in kullan\u0131l\u0131p kullan\u0131lmad\u0131\u011f\u0131n\u0131 \xf6\u011frenebilirsiniz.Uygulama Gizlili\u011fi b\xf6l\xfcm\xfcnde, uygulaman\u0131n toplayabilece\u011fi konum, ki\u015fi bilgileri, sa\u011fl\u0131k bilgileri gibi farkl\u0131 veri t\xfcrleri ve geli\u015ftiricinin veya \xfc\xe7\xfcnc\xfc taraf i\u015f ortaklar\u0131n\u0131n bu verileri kullanabilece\u011fi reklam ya da analiz gibi \xe7e\u015fitli yollar a\xe7\u0131klanmaktad\u0131r.",null,B.cQ,null,null,null,null,null,null)
B.O4=new A.b6("Sizinle \u0130li\u015fkilendirilen Veriler",null,B.cP,null,null,null,null,null,null)
B.Oz=new A.b6("Sizinle ili\u015fkilendirilmi\u015f olarak listelenen veriler, bunlar\u0131n kimli\u011finizle ili\u015fkilendirilecek bir \u015fekilde topland\u0131\u011f\u0131n\u0131 g\xf6sterir. \xd6rne\u011fin, s\xf6z konusu veriler hesab\u0131n\u0131zla, ayg\u0131t\u0131n\u0131zla veya telefon numaran\u0131z gibi bilgilerinizle ili\u015fkilendirilebilir. Verilerin topland\u0131\u011f\u0131n\u0131 ancak sizinle ili\u015fkilendirilmedi\u011fini beyan edebilmesi i\xe7in geli\u015ftiricinin, verileri toplamadan \xf6nce kullan\u0131c\u0131 kimli\u011fi benzeri do\u011frudan kimlik tan\u0131t\u0131c\u0131lar\u0131n kald\u0131r\u0131lmas\u0131 gibi gizlilik korumalar\u0131n\u0131 kullanmas\u0131 ve toplad\u0131ktan sonra verilerin kimli\u011finizle yeniden ili\u015fkilendirilmesi gibi uygulamalardan ka\xe7\u0131nmas\u0131 gerekir.",null,B.cQ,null,null,null,null,null,null)
B.Oc=new A.b6("Sizi \u0130zlemek \u0130\xe7in Kullan\u0131lan Veriler",null,B.cP,null,null,null,null,null,null)
B.Oi=new A.b6("Sizi izlemek i\xe7in kullan\u0131lan veriler, uygulamada yer alan ve ba\u015fka \u015firketlerin uygulamalar\u0131ndan, web sitelerinden veya \xe7evrimd\u0131\u015f\u0131 m\xfclklerinden toplanan verilerle ili\u015fkilendirilerek reklam sunmak amac\u0131yla kullan\u0131lan ya da bir veri simsar\u0131yla payla\u015f\u0131lan verilerdir. \u0130zleme faaliyetleriyle ilgili baz\u0131 \xf6rnekler a\u015fa\u011f\u0131da verilmi\u015ftir: Ba\u015fka \u015firketlere ait uygulamalardan ve web sitelerinden toplanan verilere dayal\u0131 olarak hedeflenmi\u015f reklamlar\u0131n g\xf6sterildi\u011fi uygulamalar. Ayg\u0131t konumu verilerinin veya e-posta listelerinin bir veri simsar\u0131yla payla\u015f\u0131ld\u0131\u011f\u0131 uygulamalar. Di\u011fer geli\u015ftiricilerin uygulamalar\u0131nda sizi hedefleyebilmesi i\xe7in e-postalar, reklam kimlikleri veya ba\u015fka kimliklerden olu\u015fan bir listenin \xfc\xe7\xfcnc\xfc taraf bir reklam a\u011f\u0131yla payla\u015f\u0131ld\u0131\u011f\u0131 uygulamalar.",null,B.cQ,null,null,null,null,null,null)
B.Ox=new A.b6("Veri kullan\u0131m\u0131 ve gizlilik prosed\xfcrleri hakk\u0131nda ek bilgiler",null,B.cP,null,null,null,null,null,null)
B.Oh=new A.b6("Uygulaman\u0131n, farkl\u0131 veri toplama prosed\xfcrlerine uyan birden fazla kullan\u0131m senaryosu varsa gizlilik bilgileri b\xf6l\xfcm\xfcnde t\xfcm prosed\xfcrler ve bu prosed\xfcrlerde verilerin nas\u0131l kullan\u0131ld\u0131\u011f\u0131 sunulmal\u0131d\u0131r. \xd6rne\u011fin, uygulaman\u0131n \xfccretli ve \xfccretsiz s\xfcr\xfcmlerinde farkl\u0131 veri toplama prosed\xfcrleri kullan\u0131l\u0131yorsa her iki durumda toplanan veri t\xfcrlerinin tamam\u0131 belirtilmelidir. Ayr\u0131ca uygulaman\u0131n yaln\u0131zca \xe7ocuklara y\xf6nelik s\xfcr\xfcm\xfcyle yeti\u015fkin s\xfcr\xfcm\xfc aras\u0131nda farkl\u0131l\u0131klar, de\u011fi\u015fik b\xf6lgelerde veri toplanmas\u0131yla ilgili farkl\u0131l\u0131klar ve uygulamay\u0131 kullan\u0131m \u015feklinize ba\u011fl\u0131 ba\u015fka farkl\u0131l\u0131klar olabilir. Uygulama geli\u015ftiricisinin gizlilik politikas\u0131nda, veri toplama prosed\xfcrlerinin \xe7e\u015fitli durumlarda nas\u0131l farkl\u0131la\u015fabilece\u011fi hakk\u0131nda daha ayr\u0131nt\u0131l\u0131 bilgi bulunabilir. Geli\u015ftirici, uygulaman\u0131n i\xe7inde sizden bilgi istiyorsa gizlilik bilgileri b\xf6l\xfcm\xfcnde bu verileri de a\xe7\u0131klamal\u0131d\u0131r. Verinin nadiren topland\u0131\u011f\u0131 ve veri toplama i\u015fleminin uygulaman\u0131n birincil i\u015flevinin par\xe7as\u0131 olmad\u0131\u011f\u0131, hangi verilerin topland\u0131\u011f\u0131n\u0131n kullan\u0131c\u0131 deneyimi s\u0131ras\u0131nda net bir \u015fekilde anla\u015f\u0131ld\u0131\u011f\u0131, hesap bilgilerinizin veya ad\u0131n\u0131z\u0131n belirgin bi\xe7imde g\xf6r\xfcnd\xfc\u011f\xfc ve bilgileri payla\u015fmay\u0131 net olarak se\xe7ti\u011finiz s\u0131n\u0131rl\u0131 durumlarda geli\u015ftirici, toplanan veri t\xfcr\xfcn\xfc a\xe7\u0131klamamay\u0131 tercih edebilir.",null,B.cQ,null,null,null,null,null,null)
B.O9=new A.b6("BiNot ve gizlilik bilgileri",null,B.cP,null,null,null,null,null,null)
B.Op=new A.b6("Binot olarak donan\u0131m, yaz\u0131l\u0131m ve servislerimizde bizim ve ba\u015fkalar\u0131n\u0131n m\xfc\u015fteri verilerine eri\u015fimimizi m\xfcmk\xfcn olan en d\xfc\u015f\xfck d\xfczeye indirecek yenilik\xe7i gizlilik teknolojileri ve teknikleri kullanmaya b\xfcy\xfck \xe7aba harc\u0131yoruz. Uygulamada ait gizlilik bilgisi \xf6zetlerinde, uygulamalar\u0131m\u0131z\u0131n toplayabilece\u011fi veri t\xfcrleri listelenir ve bu verilerin kullan\u0131c\u0131yla veya ayg\u0131tla ili\u015fkilendirilip ili\u015fkilendirilemeyece\u011fi belirtilerek kendi veri toplama prosed\xfcrlerimiz a\xe7\u0131klan\u0131r. \xc7ok \xe7e\u015fitli uygulamalar sundu\u011fumuz ve bu uygulamalarda m\xfc\u015fterilere farkl\u0131 deneyimler sa\u011flad\u0131\u011f\u0131m\u0131z i\xe7in s\xf6z konusu gizlilik \xf6zetleri uygulamaya g\xf6re farkl\u0131l\u0131k g\xf6sterir ve m\xfc\u015fterilerin bilgilerini koruman\u0131n yeni yollar\u0131 konusunda \xe7al\u0131\u015fmalar\u0131m\u0131z devam ettik\xe7e g\xfcncellenirler. Bu bilgilerin sunulmas\u0131, m\xfc\u015fterilerin kendi gizlilikleri hakk\u0131nda bilgi sahibi olmas\u0131na ve daha iyi kararlar almas\u0131na yard\u0131mc\u0131 olur. Size daha da iyi deneyimler ya\u015fatacak uygulamalar sunmak i\xe7in yo\u011fun bir \u015fekilde \xe7al\u0131\u015fmaya devam edece\u011fiz ve uygulamalar\u0131m\u0131z\u0131n tasar\u0131m\u0131nda gizlilik unsurunu en ba\u015ftan itibaren g\xf6z \xf6n\xfcnde bulunduraca\u011f\u0131z.",null,B.cQ,null,null,null,null,null,null)
